window.bookSummaryJSON = "<p>She’s a runner, but the campus star quaterback runs faster than she does!</p> <p>Rocky has had a chaotic life from which she concluded three fundamental things: life is a succession of problems to be solved, men are assholes to be avoided and promises are only binding on fools who want to believe in them. So, unlike the other girls on campus, boys are not a priority for her. Worse, she sees them as an obstacle to her success!</p> <p>But during a student party, she meets Jude. Freshly transferred from Harvard to play on Brown’s soccer team, Jude is the new star on campus. Handsome and inaccessible, he is the type not to get attached: the perfect candidate for a one-night stand.</p> <p>But the chemistry is too strong. And though Rocky is determined to run away from him, he is determined to conquer her heart.</p>"; 
